BAPE® X COACH COLLECTION
Celebrating the shared optimistic and authentic attitude of their hometowns, Tokyo and New York, the collection of ready-to-wear, leathergoods, footwear and accessories combines BAPE®’s authority in streetwear with Coach’s legacy of craftsmanship. It features bags, hoodies and t-shirts printed with a limited-edition pattern that merges the house’s iconic Signature with BAPE®’s APE HEAD logo.

